import classes from "./LandingPage.module.css";
import { Fragment } from "react";
import Header from "./Header.js";
import Card from "../../UI/Card";


const LandingPage = () => {


  return (
    <Fragment>
      <Header />
      <Card>
        <main className="main" style={{alignItems: "center"}}>
            <h2>Welcome</h2>              
        </main>
      </Card>
    </Fragment>
  );
};

export default LandingPage;
